import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import "./Found.css";

const Funds = () => {
  const [fundsData, setFundsData] = useState({
    equity: {
      availableMargin: 4043.10,
      usedMargin: 3757.30,
      availableCash: 4043.10,
      openingBalance: 4043.10,
      payout: 3736.40,
      payin: 4064.00,
      span: 0.00,
      deliveryMargin: 0.00,
      exposure: 0.00,
      optionsPremium: 0.00,
      collateralLiquid: 0.00,
      collateralEquity: 0.00,
      totalCollateral: 0.00
    },
    commodity: {
      hasAccount: false
    }
  });

  const [showAddFundsModal, setShowAddFundsModal] = useState(false);
  const [showWithdrawModal, setShowWithdrawModal] = useState(false);

  // Simulate fetching real data
  useEffect(() => {
    // In real app, this would be an API call
    const fetchFundsData = async () => {
      // const response = await fetch('/api/funds');
      // const data = await response.json();
      // setFundsData(data);
    };
    fetchFundsData();
  }, []);

  const handleAddFunds = () => {
    setShowAddFundsModal(true);
  };

  const handleWithdraw = () => {
    setShowWithdrawModal(true);
  };

  const fundSections = [
    {
      title: "Margin Summary",
      data: [
        { label: "Available margin", value: fundsData.equity.availableMargin, type: "positive", important: true },
        { label: "Used margin", value: fundsData.equity.usedMargin, type: "neutral", important: true },
        { label: "Available cash", value: fundsData.equity.availableCash, type: "positive", important: true }
      ]
    },
    {
      title: "Balance Details",
      data: [
        { label: "Opening balance", value: fundsData.equity.openingBalance },
        { label: "Payout", value: fundsData.equity.payout },
        { label: "Payin", value: fundsData.equity.payin },
        { label: "SPAN", value: fundsData.equity.span },
        { label: "Delivery margin", value: fundsData.equity.deliveryMargin },
        { label: "Exposure", value: fundsData.equity.exposure },
        { label: "Options premium", value: fundsData.equity.optionsPremium }
      ]
    },
    {
      title: "Collateral",
      data: [
        { label: "Collateral (Liquid funds)", value: fundsData.equity.collateralLiquid },
        { label: "Collateral (Equity)", value: fundsData.equity.collateralEquity },
        { label: "Total collateral", value: fundsData.equity.totalCollateral, important: true }
      ]
    }
  ];

  return (
    <div className="funds-container">
      {/* Header Section */}
      <div className="funds-header">
        <div className="header-content">
          <h1 className="funds-title">Funds</h1>
          <p className="funds-subtitle">Instant, zero-cost fund transfers with UPI</p>
        </div>
        <div className="action-buttons">
          <button className="btn btn-green" onClick={handleAddFunds}>
            <span className="btn-icon">💵</span>
            Add funds
          </button>
          <button className="btn btn-blue" onClick={handleWithdraw}>
            <span className="btn-icon">🏦</span>
            Withdraw
          </button>
        </div>
      </div>

      {/* Main Content Grid */}
      <div className="funds-grid">
        {/* Equity Section */}
        <div className="funds-card">
          <div className="card-header">
            <h3 className="card-title">
              <span className="card-icon">📈</span>
              Equity
            </h3>
            <div className="card-actions">
              <button className="action-link">View statement</button>
              <button className="action-link">Download</button>
            </div>
          </div>

          <div className="funds-data">
            {fundSections.map((section, sectionIndex) => (
              <div key={sectionIndex} className="data-section">
                <h4 className="section-title">{section.title}</h4>
                {section.data.map((item, itemIndex) => (
                  <div key={itemIndex} className="data-row">
                    <span className="data-label">{item.label}</span>
                    <span className={`data-value ${item.type || ''} ${item.important ? 'important' : ''}`}>
                      ₹{item.value.toLocaleString('en-IN')}
                    </span>
                  </div>
                ))}
                {sectionIndex < fundSections.length - 1 && <hr className="section-divider" />}
              </div>
            ))}
          </div>
        </div>

        {/* Commodity Section */}
        <div className="funds-card">
          <div className="card-header">
            <h3 className="card-title">
              <span className="card-icon">⛏️</span>
              Commodity
            </h3>
          </div>

          <div className="commodity-content">
            {fundsData.commodity.hasAccount ? (
              <div className="account-active">
                <p className="account-status">Commodity account active</p>
                <div className="commodity-data">
                  <div className="data-row">
                    <span className="data-label">Available margin</span>
                    <span className="data-value positive">₹0.00</span>
                  </div>
                  <div className="data-row">
                    <span className="data-label">Used margin</span>
                    <span className="data-value neutral">₹0.00</span>
                  </div>
                </div>
              </div>
            ) : (
              <div className="account-inactive">
                <div className="inactive-icon">🔒</div>
                <p className="inactive-text">You don't have a commodity account</p>
                <button className="btn btn-outline">
                  Open Commodity Account
